import React from 'react'


const ColumnNames = () => (
    
       <div>
            <span style={headerStyle}>Actions</span>
            <span>Map Name</span>
            <span>Team ID 1</span>
            <span>Team ID 2</span>
            <span>Attacking Team</span>
            <span>Warnings</span>
        </div>
)

let headerStyle = {
    "margin-right": "30",
    "color": "#40C5FF"
}

export default ColumnNames;
